I didn't see a way for lodash to nicely partition a collection into bins. Sometimes, in JavaScript, you want to group items by some property that doesn't translate to a string key very well. For example, grouping a collection into equivalence classes.

For my own code, I ended up doing something like this:

``` js
var genericGroup = (keyFn, valueFn, eqFn, collection) => collection.reduce((acc, item) => {
    var key =  keyFn(item);
    var val = valueFn(item);
    var bin = _.find((x) => eqFn(x.key, key), acc);
    if (bin) {
        bin.items.push(item);
    } else {
        acc.push({ key: key, items: [val] });
    }
    return acc;
}, []).map((x) => x.items);
```

Is there interest for this kind of function in lodash? Any ideas of a nicer way to do this? The idea is that your keying function doesn't have to map to a string -- it can accept an equivalence on keys to bin values by. You could potentially output tuples of `[key, items[]][]`, or similar. I imagine this would be a `_.binBy`. 

I might be totally missing the forest from the trees here.

